import { Card, CardHeader } from "@material-ui/core";
import React, {useEffect, useState} from 'react';

import axios from 'axios';

const access_token = '9_HW2X8YspdsGcABsncg';

const fetchMovies = async () => {
    // const response = await fetch(`https://the-one-api.dev/v2/movie`);
    // const result = await response.json();
    // return result;

    axios.get('https://the-one-api.dev/v2/movie', {
        headers: {
        'Authorization': `token ${access_token}`
        }
    })
    .then((res) => {
        console.log(res.data)
    })
    .catch((error) => {
        console.error(error)
    })


};


const List = () => {
    const [movies, setMovies] = useState([]);

    // useEffect(() => {
    //     fetchMovies().then(data => setMovies(data.docs));
    // }, []);

    setMovies(fetchMovies);

    return (
        <section>
            {movies.map(movie => {
                return (
                    <Item key={movie._id} movie={movie}/>
                )
            })}
        </section>
    );
}

const Item = ({movie}) => {
    return (
      <Card>
        <CardHeader
          title={movie.name}
          subheader={movie._id}
        />
      </Card>
    );
}

const Movies = () => {
    return (
        <div className="movies">
            <List/>
        </div>
    );
}

export default Movies;
